class Offer {
  constructor(name, id, price, size, store, storeImage, created, ending) {
    this.name = name;
    this.id = id;
    this.price = price;
    this.size = size;
    this.store = store;
    this.storeImage = storeImage;
    this.created = created;
    this.ending = ending;
  }
}

export default Offer;
